import React from 'react';

const CompareList = () => (
  <div>
    <div>
      <header>
        <img
          src="https://avatars3.githubusercontent.com/u/69631?v=4"
          alt="facebook logo"
        />
        <strong>React</strong>
        <small>Facebook</small>
      </header>
    </div>
  </div>
);

export default CompareList;
